    false,nt"url": null,nt"notes": "Fish surveys were conducted in November
    2007 using visual census techniques at Fagatele Bay under the guidance of Dr. Alison
    Green, the Nature Conservancy. This data set was collected at Transect 2, Fagatele
    Bay, in collaboration with surveys of NODC Accession 0066319, which is composed
    of coral and benthic surveys by Dr. Douglas Fenner and Dr. Charles Birkeland. Set
    0066319 includes other locations on Tutuila, though this fish set is only from Fagatele
    Bay, and due to conditions, was restricted to Transect 2, at depths of 3, 6, 9,
    12, and 18m.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
